let s = "", t = "" //Expected: "t"

class Solution {
    func findTheDifference(_ s: String, _ t: String) -> Character {
        var ch: Character = "q"
        
        var s = s.sorted()
        var t = t.sorted()
        
        for i in t {
            if s.contains(i) {
                s.removeFirst()
            } else {
                ch = i
            }
        }
        
        print(ch)
        return ch
    }
}

Solution().findTheDifference(s, t)

